import { Component } from '@angular/core';
import { InfoData } from '../ui/info-card/info-card.component';

@Component({
  selector: 'app-services',
  templateUrl: './services.component.html',
  styleUrls: ['./services.component.css']
})
export class ServicesComponent {
  infoData: InfoData[] = [
    {
      icon: 'fa-utensils',
      title: 'Top Chefs',
      description: "Our chefs are world-class professionals with a passion for excellence."
    }
  ]
}
